  false,\n\t\"url\": null,\n\t\"notes\": \"This Digital Elevation Model (DEM) dataset,
  published at 1:1200 (1in=100ft) scale, was produced all or in part from Orthoimagery
  information as of 2008. It is described as '2 foot contours developed from aerial
  photography derived mass points. Meets ASPRS 1:1200 scale horizontal accuracy and
  ASPRS class 1.5 for verticle.'. Data by this publisher are often provided in State
  Plane coordinate system; in a Lambert Conformal-conic projection; The extent of
  these data is generally Statewide Coverage in District of Columbia. It will support
  a 2 feet contour interval. These data include break lines Control monumentation
  used to create these data are available. This metadata was auto-generated through
